-- global
GRAVITY = 0.70
FRICTION = 0.75
AIR = 0.90
MAX_SEED = 6
t=0

game_state = "title"

player = {
	x = 400,
	y = 24,
	w = 16,
	h = 16,
	dx = 0,
	dy = 0,
	speed = 2,
    jump  = 6,
    on_ground = false,
	anim = idle_animation,
	state = "idle",
	action = "none",
	counter = 0,
	flip = 0,
    jumps = 0,
    max_jumps = 2,
	dmg_cd = 0,
	hp = 3,
	ox = 4,
	wall = -1,
}

camera = {
	x = 0,
	y = 0,
}

function TIC()
	if game_state == "title" then
		draw_title()
	elseif game_state == "loading" then
		draw_loading()
	elseif game_state == "game" then
		draw_game()
	end
	t=t+1
end

tmp = 0
function draw_title()
	sync(0,0,false)
	map(0,0,30,17,0,0,-1,1)
	local frame = math.floor(t%120/40)
	spr(416 + 32*frame,72,96,-1,1,0,0, 12, 2)
	if btnp(4) then
		game_init()
		game_state = "loading"
		next_state = "game"
		now = t
	end
end

function draw_loading()
	local d = 60
	local y = 0

	if t-now > 2*d then
		game_state = next_state
		return
	elseif t-now < d then
		y = (160/d)*(t-now)
	else
		if next_state == "game" then
			game_init()
			draw_map()
		else
			draw_title()
		end
		y = (160/d)*(2*d + now - t)
	end

	for i=0,240/5 do
		line(i*5+0,0,i*5+0,y+0,15)
		line(i*5+1,0,i*5+1,y+1,14)
		line(i*5+2,0,i*5+2,y+2,14)
		line(i*5+3,0,i*5+3,y+2,14)
		line(i*5+4,0,i*5+4,y+1,14)
	end
	
end

function draw_game()
	if player.hp <= 0 and player.dmg_cd <= 1 then
		game_state = "loading"
		next_state = "title"
		now = t
	else
		cls()
		draw_map()
		player_update()
		player_draw()
		draw_ui()	
	end	
end

function camera_update()
    camera.x = player.x - 120  -- 240 / 2
    --camera.y = player.y - 68   -- 136 / 2

    camera.x = math.max(0, math.min(camera.x, (240*8)-240))
    --camera.y = math.max(0, math.min(camera.y, (136*8)-136))
end

function draw_map()
	camera_update()
	local map_x = math.floor(camera.x / 8)
	local map_y = math.floor(camera.y / 8)
	local offset_x = -(camera.x % 8)
	local offset_y = -(camera.y % 8)
	map(map_x, map_y, 31, 18, offset_x, offset_y)
end

function draw_ui()
	for i = 0, player.hp - 1, 1 do
		spr(240, 1 + i*9, 1, 1)
	end
end

function game_init()
	sync(0,1,false)
	player.x = 400
	player.y = 24
	player.hp = 3
	player.state = "idle"
end

function player_input()
	-- movement --
	if btn(2) then player.dx = -player.speed end
	if btn(3) then player.dx =  player.speed end

	if (btnp(0) or btnp(4)) and 
    player.jumps < player.max_jumps then
		player.jumps = player.jumps + 1
		player.dy = -player.jump
		if player.state == "wall" then
			player.jumps = player.jumps - 1
			player.wall = player.flip
			player.dx = - (player.speed - 2*player.flip*player.speed)
		end
	end

	player.craw   = false 
	player.attack = false
	if btn(1) and player.dx == 0 and player.dy == 0 then 
		player.action = "craw" 
	end
	if btn(5) then
		player.action = "attack"
	end

end

function draw_attack()
	if player.counter == 0 then
		spr(480, player.x + 18*player.flip - 4 - camera.x, player.y + 4, 5, 1, player.flip, 0, 1, 1)
	elseif player.counter == 1 then
		spr(448, player.x - 9 + 18*player.flip - camera.x, player.y, 5, 1, player.flip, 0, 2, 1)
	elseif player.counter == 2 then
		spr(465, player.x + 15 - 22*player.flip - camera.x, player.y - 4, 5, 1, player.flip, 0, 1, 3)
		spr(464, player.x + 7 - 6*player.flip - camera.x, player.y - 4, 5, 1, player.flip, 0, 1, 1)
	elseif player.counter == 3 then
		spr(496, player.x + 4 - camera.x, player.y + 8, 5, 1, player.flip, 0, 1, 1)
	end
end

function player_draw()
	if player.state == "idle" then
		player.anim = idle_animation
	elseif player.state == "run" then
		player.anim = run_animation
	elseif player.state == "jump" then
		player.anim = jump_animation
    elseif player.state == "fall" then
        player.anim = fall_animation
    elseif player.state == "double_jump" then
        player.anim = jump2_animation
    elseif player.state == "craw" then
        player.anim = craw_animation
    elseif player.state == "wall" then
        player.anim = wall_animation
    elseif player.state == "attack" then
        player.anim = attack_animation
	elseif player.state == "death" then
		print("YOU DIED!", 74, 62, 14, false, 2)
		print("YOU DIED!", 75, 63, 15, false, 2)
		player.anim = death_animation
	end
	-- print(player.state, 10,10)
	player.counter = draw_object(player)
	if player.state == "attack" then
		draw_attack()
	end
end


function player_states()
    new_state = ""
    if player.hp <= 0 then
        new_state = "death"
    elseif player.action ~= "none" then
		new_state = player.action
		player.action = "none"
	elseif player.dy >= 0 and player.on_ground == false then
		if (get_flag(player, "right", 2) 
		or get_flag(player, "left", 2))
		--and player.dx ~= 0
		and player.wall ~= player.flip then
			new_state = "wall"
			--player.jumps = 0
		else
        	new_state = "fall"
		end
    elseif player.dy < 0 then
        new_state = "jump"
    elseif player.dx ~= 0 then
        new_state = "run"
	else
		new_state = "idle"
	end

    if player.dx < 0 then
		player.flip = 1
	elseif player.dx > 0 then
		player.flip = 0
	end

    if player.state ~= new_state then
        player.counter = 0
        player.state = new_state
		loop = 1
	end
end

function player_update()
	if player.on_ground == true then
		player.jumps = 0
		player.wall = -1
	end
	if player.state ~= "death" then 
		player_input()
		player_states()
	end

    gravity(player)
	collision_x(player)
	player.x = player.x + player.dx
	collision_y(player)
	player.y = player.y + player.dy
	
	check_env(player)
end

function debug(obj)
	local top_left  = {x = (obj.x + obj.ox),             y = (obj.y)}
	local bot_left  = {x = (obj.x + obj.ox),             y = (obj.y + obj.h - 1)}
	local top_right = {x = (obj.x + obj.w - 1 - obj.ox), y = (obj.y)}
	local bot_right = {x = (obj.x + obj.w - 1 - obj.ox), y = (obj.y + obj.h - 1)}

	local mid_left  = getMidpoint(top_left,  bot_left)
	local mid_right = getMidpoint(top_right, bot_right)
	local mid_top   = getMidpoint(top_left, top_right)
	local mid_bot   = getMidpoint(bot_left, bot_right)

	pix(top_left.x, top_left.y, 14)
	pix(bot_left.x, bot_left.y, 14)
	pix(top_right.x, top_right.y, 14)
	pix(bot_right.x, bot_right.y, 14)

	pix(mid_left.x, mid_left.y, 14)
	pix(mid_right.x, mid_right.y, 14)
	pix(mid_top.x, mid_top.y, 14)
	pix(mid_bot.x, mid_bot.y, 14)

	print("x = " .. obj.x, 0, 0)
	print("y = " .. obj.y, 0, 10)
end

function get_flag(obj, dir, flag)
	local top_left  = {x = (obj.x + obj.ox),             y = (obj.y)}
	local bot_left  = {x = (obj.x + obj.ox),             y = (obj.y + obj.h - 1)}
	local top_right = {x = (obj.x + obj.w - 1 - obj.ox), y = (obj.y)}
	local bot_right = {x = (obj.x + obj.w - 1 - obj.ox), y = (obj.y + obj.h - 1)}
	local mid_left  = getMidpoint(top_left,  bot_left)
	local mid_right = getMidpoint(top_right, bot_right)
	local top_mid   = getMidpoint(top_left, top_right)
	local bot_mid   = getMidpoint(bot_left, bot_right)

	if dir == "left" then
		if fget(mget((top_left.x -1)/8, top_left.y/8), flag) or
		   fget(mget((mid_left.x -1)/8, mid_left.y/8), flag) or
		   fget(mget((bot_left.x -1)/8, bot_left.y/8), flag) then
			return true
		end
	end

	if dir == "right" then
		if fget(mget((top_right.x +1)/8, top_left.y/8), flag) or
		   fget(mget((mid_right.x +1)/8, mid_left.y/8), flag) or
		   fget(mget((bot_right.x +1)/8, bot_left.y/8), flag) then
			return true
		end
	end

	if dir == "up" then
		if fget(mget(top_left.x/8,  (top_left.y - 1)/8) , flag) or
		   fget(mget(top_mid.x/8,   (top_mid.y - 1)/8)  , flag) or
		   fget(mget(top_right.x/8, (top_right.y - 1)/8), flag) then
			return true
		end
	end

	if dir == "down" then
		if fget(mget(bot_left.x/8,  (bot_left.y + 1)/8) , flag) or
		   fget(mget(bot_mid.x/8,   (bot_mid.y + 1)/8)  , flag) or
		   fget(mget(bot_right.x/8, (bot_right.y + 1)/8), flag) then
			return true
		end
	end

	return false
end


function check_env(obj)
	if get_flag(obj, "down", 1) and obj.dmg_cd == 0 then
		obj.dy = -4
		obj.hp = obj.hp - 1
		if obj.hp == 0 then 
			obj.dmg_cd = 180
		else
			obj.dmg_cd = 60
		end
	elseif get_flag(obj, "left", 1) and obj.dmg_cd == 0 then
		obj.dx = 4
		obj.hp = obj.hp - 1
		if obj.hp == 0 then 
			obj.dmg_cd = 180
		else
			obj.dmg_cd = 60
		end
	elseif get_flag(obj, "right", 1) and obj.dmg_cd == 0 then
		obj.dx = -4
		obj.hp = obj.hp - 1
		if obj.hp == 0 then 
			obj.dmg_cd = 180
		else
			obj.dmg_cd = 60
		end
	else
		if obj.dmg_cd > 0 then
			obj.dmg_cd = obj.dmg_cd - 1
		end
	end
end

loop = 1
function draw_object(obj)
	if t % obj.anim.speed == 0 then
		obj.counter = obj.counter + loop
		if obj.counter == obj.anim.num then
			if obj.anim.loop == 0 then
				obj.counter = obj.anim.num -1
			elseif obj.anim.loop == 1 then
				obj.counter = 0
			elseif obj.anim.loop == 2 then
				obj.counter = obj.anim.num -1
				loop = -loop
			end
		elseif obj.counter == -1 then
			if obj.anim.loop == 2 then
				obj.counter = 0
				loop = -loop
			end
		end
	end
	
	local offset_rows = math.floor(obj.anim.id/(16 * obj.anim.h))
	local offset_cols = (obj.anim.id - (offset_rows * 16 * obj.anim.h)) / obj.anim.w
	local offset = offset_rows * 8 + offset_cols
	local sprite_id = ((obj.counter + offset) * obj.anim.w) % 16 + math.floor((obj.counter +offset) * obj.anim.w / 16) * 16 * obj.anim.h
	spr(sprite_id, obj.x - camera.x, obj.y, 5, 1, obj.flip, 0, obj.anim.w, obj.anim.h)

	return obj.counter
end

-- gravity --
function gravity(obj)
    if obj.on_ground == false then
		if obj.state == "wall" then obj.dy = 0.4-- 0.5--obj.dy + 0.1
        else obj.dy = obj.dy + GRAVITY end
        if obj.state == "wall" then
			if obj.dy > 1.5 then
				obj.dy = 1.5
			end
		else
			if obj.dy > 7 then
				obj.dy = 7
			end
		end
		if obj.dx > 0 then
			obj.dx = math.floor(10*obj.dx * AIR)/10
		elseif obj.dx < 0 then
			obj.dx = math.ceil(10*obj.dx * AIR)/10
		end
    else
		if obj.dx > 0 then
			obj.dx = math.floor(10*obj.dx * FRICTION)/10
		elseif obj.dx < 0 then
			obj.dx = math.ceil(10*obj.dx * FRICTION)/10
		end
	end

end

-- collisions --
function getMidpoint(p1, p2)
  local midX = math.floor((p1.x + p2.x) / 2)
  local midY = math.floor((p1.y + p2.y) / 2)
  return {x = midX, y = midY}
end

function collision_x(obj)
    -- x axis --
    local top_left  = {x = (obj.x - 1 + obj.ox + obj.dx),      y = (obj.y)}
    local top_right = {x = (obj.x + obj.w - obj.ox + obj.dx),  y = (obj.y)}
    local bot_left  = {x = (obj.x - 1 + obj.ox + obj.dx),      y = (obj.y + obj.h - 1)}
    local bot_right = {x = (obj.x + obj.w - obj.ox + obj.dx),  y = (obj.y + obj.h - 1)}
    local mid_left  = getMidpoint(top_left,  bot_left)
    local mid_right = getMidpoint(top_right, bot_right)

    if fget(mget(top_left.x/8, top_left.y/8),0) or
       fget(mget(mid_left.x/8, mid_left.y/8),0) or
       fget(mget(bot_left.x/8, bot_left.y/8),0) then
        if obj.dx < 0 then
		    obj.dx = math.ceil(top_left.x/8)*8 - (obj.x + obj.ox)
        end
    end

    if fget(mget(top_right.x/8, top_right.y/8),0) or
       fget(mget(mid_right.x/8, mid_right.y/8),0) or
       fget(mget(bot_right.x/8, bot_right.y/8),0) then
        if obj.dx > 0 then
            obj.dx = math.floor((top_right.x)/8)*8 - (obj.x + obj.w - obj.ox)
        end
    end
end

function collision_y(obj)
    -- y axis --
    local top_left  = {x = (obj.x + obj.ox),      		 y = (obj.y - 1 + obj.dy)}
    local top_right = {x = (obj.x + obj.w -1 - obj.ox),  y = (obj.y - 1 + obj.dy)}
    local bot_left  = {x = (obj.x + obj.ox),      	     y = (obj.y + obj.h + obj.dy)}
    local bot_right = {x = (obj.x + obj.w -1 - obj.ox),  y = (obj.y + obj.h + obj.dy)}
    local top_mid   = getMidpoint(top_left, top_right)
    local bot_mid   = getMidpoint(bot_left, bot_right)

    if fget(mget(top_left.x/8,  top_left.y/8),0) or
       fget(mget(top_mid.x/8,   top_mid.y/8),0) or
       fget(mget(top_right.x/8, top_right.y/8),0) then
        if obj.dy < 0 then
		    obj.dy = math.ceil(top_mid.y/8)*8 - (obj.y)
        end
    end

    if (fget(mget(bot_left.x/8,  bot_left.y/8),0) or
       fget(mget(bot_mid.x/8,   bot_mid.y/8),0) or
       fget(mget(bot_right.x/8, bot_right.y/8),0)) then
		player.on_ground = true
		if obj.dy > 0 then
            obj.dy = math.floor(bot_mid.y/8)*8 - (obj.y + obj.h)
        end
	else
		player.on_ground = false
	end
end

